rule "Syslog - VMWARE ESXI - Extract Shell info"
when
  has_field("application_name") AND regex("shell", to_string($message.application_name)).matches == true
then
  let msg = to_string($message.message);

  let shell1 = grok(pattern: "\\[%{DATA:vmw_esxi_username}\\]: %{GREEDYDATA:vmw_esxi_shell_cmd}", value: to_string(msg), only_named_captures: true);
  set_fields(shell1);

end

rule "Syslog - VMWARE ESXI - Extract vmw_esxi_title & vmw_esxi_info_message"
when
  has_field("message") AND regex("Hostd|Rhttpproxy|Vpxa|vsansystem|hostd-probe|sandboxd|healthd|kmxa", to_string($message.application_name)).matches == true
then
  let msg = to_string($message.message);
  let vmware_log_noID = grok(pattern: "\\[(Originator@6876|vSAN@6876)\\s+%{DATA:vmw_esxi_title}\\]\\s%{GREEDYDATA:vmw_esxi_info_message}", value: to_string(msg), only_named_captures: true);
  set_fields(vmware_log_noID);
end

rule "Syslog - VMWARE ESXI - vmw_esxi_info_message - Extract data"
when
  has_field("vmw_esxi_info_message")
then
  let msg = to_string($message.vmw_esxi_info_message);
  let vmware_log_resolvedendpoint = grok(pattern: "[Resolved endpoint : ]+\\[%{GREEDYDATA:vmw_esxi_endpoint}\\:%{PROG:vmw_esxi_process_log}\\]\\s[_serverNamespace]+\\s[=]\\s+%{DATA:vmw_esxi_serverNamespace}\\ [action]+\\s[= ]+%{WORD:vmw_esxi_action}\\s[authenticationParams]+[ = ]%{DATA:vmw_esxi_authenticationParams}\\= [_port = ]+%{BASE10NUM:vmw_esxi_port}", value: to_string(msg), only_named_captures: true);
  set_fields(vmware_log_resolvedendpoint);


  let hostd_probe_hardware = grok(pattern: "Successfully acquired hardware: %{GREEDYDATA:vmw_esxi_hypervisor_hardware_model}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_probe_hardware);

  let hostd_probe_advancedoption = grok(pattern: "Successfully acquired advanced option: %{GREEDYDATA:vmw_esxi_hypervisor_advanced_option}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_probe_advancedoption);

  let rhttpproxy_io_obj = grok(pattern: "Connected to localhost:%{BASE10NUM:vmw_esxi_localhost_port} \\(%{DATA:vmw_esxi_serverNamespace}\\) over <vmw_esxi_io_obj %{GREEDYDATA:vmw_esxi_io_obj}\\>", value: to_string(msg), only_named_captures: true);
  set_fields(rhttpproxy_io_obj);

  let hostd_logout = grok(pattern: "Event %{BASE10NUM:vmw_esxi_event_id} : User %{DATA:vmw_esxi_username}@%{IPV4:vmw_esxi_src_ip} logged %{DATA:vmw_esxi_login_status} ", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_logout);

  let hostd_password_status_login2 = grok(pattern: "Event %{BASE10NUM:vmw_esxi_event_id} : User %{DATA:vmw_esxi_username}@%{IPV4:vmw_esxi_src_ip} logged %{DATA:vmw_esxi_login_status} as %{GREEDYDATA:vmw_esxi_login_type}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_password_status_login2);

  let hostd_password_status_login = grok(pattern: "%{DATA:vmw_esxi_login_status} for user %{DATA:vmw_esxi_username} from %{IPV4:vmw_esxi_src_ip} - session=%{GREEDYDATA:vmw_esxi_session_id}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_password_status_login);

  let hostd_vm_activities1 = grok(pattern: "Event %{BASE10NUM:vmw_esxi_event_id} : Guest OS %{DATA:vmw_esxi_status_action} for %{HOSTNAME:vmw_esxi_virtual_machine_name} on %{HOSTNAME:vmw_esxi_name} in %{HOSTNAME:vmw_esxi_datacenter_name}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_vm_activities1);

  let hostd_vm_activities2 = grok(pattern: "Event %{BASE10NUM:vmw_esxi_event_id} : %{HOSTNAME:vmw_esxi_virtual_machine_name} on  %{HOSTNAME:vmw_esxi_name} in %{HOSTNAME:vmw_esxi_datacenter_name} is %{GREEDYDATA:vmw_esxi_status_action}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_vm_activities2);

  let hostd_vm_activities6= grok(pattern: "Event %{BASE10NUM:vmw_esxi_event_id} : %{HOSTNAME:vmw_esxi_virtual_machine_name} on  %{HOSTNAME:vmw_esxi_name} in %{HOSTNAME:vmw_esxi_datacenter_name} has %{GREEDYDATA:vmw_esxi_status_action}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_vm_activities6);

  let hostd_vm_activities3 = grok(pattern: "Event %{BASE10NUM:vmw_esxi_event_id} : %{HOSTNAME:vmw_esxi_status_action} %{HOSTNAME:vmw_esxi_virtual_machine_name} on %{HOSTNAME:vmw_esxi_name} in %{HOSTNAME:vmw_esxi_datacenter_name}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_vm_activities3);

  let hostd_vm_activities5 = grok(pattern: "Event %{BASE10NUM:vmw_esxi_event_id} : %{HOSTNAME:vmw_esxi_virtual_machine_name} on %{HOSTNAME:vmw_esxi_name} in %{HOSTNAME:vmw_esxi_datacenter_name} is %{GREEDYDATA:vmw_esxi_status_action}", value: to_string(msg), only_named_captures: true);
  set_fields(hostd_vm_activities5);







end

rule "Syslog - VMWARE ESXI - Extract SSH info"
when
  has_field("application_name") AND regex("sshd", to_string($message.application_name)).matches == true
then
  let msg = to_string($message.message);

  let sshd1 = grok(pattern: "%{DATA:vmw_esxi_session_state} for %{USERNAME:vmw_esxi_username} from %{IPV4:vmw_esxi_src_ip} port %{DATA:vmw_esxi_src_port} %{GREEDYDATA:vmw_esxi_app_name}", value: to_string(msg), only_named_captures: true);
  set_fields(sshd1);

  let sshd3 = grok(pattern: "%{DATA:vmw_esxi_session_state} from user %{USERNAME:vmw_esxi_username} %{IPV4:vmw_esxi_src_ip} port %{BASE10NUM:vmw_esxi_src_port}", value: to_string(msg), only_named_captures: true);
  set_fields(sshd3);

  let sshd2 = grok(pattern: "%{DATA:vmw_esxi_session_state} for invalid user %{USERNAME:vmw_esxi_username} from %{IPV4:vmw_esxi_src_ip} port %{DATA:vmw_esxi_src_port} %{GREEDYDATA:vmw_esxi_app_name}", value: to_string(msg), only_named_captures: true);
  set_fields(sshd2);

  let sshd5 = grok(pattern: "%{DATA:vmw_esxi_session_state} by invalid user %{USERNAME:vmw_esxi_username} %{IPV4:vmw_esxi_src_ip} port %{BASE10NUM:vmw_esxi_src_port}", value: to_string(msg), only_named_captures: true);
  set_fields(sshd5);

  let sshd8 = grok(pattern: "%{DATA:vmw_esxi_session_state} from %{IPV4:vmw_esxi_src_ip} port %{BASE10NUM:vmw_esxi_src_port}", value: to_string(msg), only_named_captures: true);
  set_fields(sshd8);

  let sshd4 = grok(pattern: "error: %{DATA:vmw_esxi_application_type}: %{DATA:vmw_esxi_failure_type} for %{USERNAME:vmw_esxi_username} from %{IPV4:vmw_esxi_src_ip}", value: to_string(msg), only_named_captures: true);
  set_fields(sshd4);

  let sshd7 = grok(pattern: "%{DATA:vmw_esxi_application_type}\\(sshd:session\\): session %{DATA:vmw_esxi_session_state} for user %{USERNAME:vmw_esxi_username}", value: to_string(msg), only_named_captures: true);
  set_fields(sshd7);

  let sshd9 = grok(pattern: "fatal: %{DATA:vmw_esxi_failure_type} for %{IPV4:vmw_esxi_src_ip} port %{BASE10NUM:vmw_esxi_src_port}", value: to_string(msg), only_named_captures: true);
  set_fields(sshd9);


end
